local iterator = 1
local newIterator = false

-- returns the element from the random list and increments the iterator
BanditRandom.Get = function()
    local ret = numbers[iterator]
    iterator = iterator + 1
    if iterator > 10000 then iterator = 1 end
    return ret
end

-- server qill requests all clients to reposition the iterator,
BanditRandom.IteratorChangeReveiver = function(args)
    newIterator = args.iterator
end

-- clients may receive that iterator change request at a slightly different time
-- that is why they should not change it immediately but do it in the separate internal event
local everyOneMinute = function()
    if isServer() then return end
    if newIterator then
        iterator = newIterator
        newIterator = false
    end
end

-- server request receiver
local onServerCommand = function(module, command, args)
    if module == "BanditRandom" and BanditRandom[command] then
        local argStr = ""
        for k, v in pairs(args) do
            argStr = argStr .. " " .. k .. "=" .. tostring(v)
        end
        -- print ("client received " .. module .. "." .. command .. " "  .. argStr)
        BanditRandom[command](args)
    end
end

Events.EveryOneMinute.Add(everyOneMinute)
Events.OnServerCommand.Add(onServerCommand)